//開通測試
$('#sendtesting_btn').click(function () {
    if (!paymentcheck()) {
        return;
    }
    if (!checkmerchantname()) {
        return;
    }

    if (!$('#clause').prop('checked')) {
        alert("未勾選同意會員註冊條款!");
        $('#clause').focus();
        return;
    }

    if (confirm("確認資料已填妥並建立商家?")) {
        $("#createform").submit();
    }
});


function checkmerchantname() {
    var format = /^[/s A-Za-z0-9/,./]+$/;
    var merchantname_e = document.getElementById('merchantname_e').value;
    if (merchantname_e != "" && format.test(merchantname_e) == false) {
        alert("商店對外英文名稱格式錯誤!");
        return false;
    }
    return true;
}

function paymentcheck() {
    if (!document.getElementById('cc').checked
        && !document.getElementById('atm').checked
        && !document.getElementById('webatm').checked
        && !document.getElementById('mmk').checked) {
        alert("未選取支付工具選項!");
        return false;
    }
    return true;
}

