//帳務地址同上
function billingaddress_same() {
    if ($('#billingaddress_same').prop('checked')) {
        $('#billingaddress_city').attr('disabled', 'disabled');
        $('#billingaddress_city').val('');

        $('#billingaddress_area').attr('disabled', 'disabled');
        $('#billingaddress_area').val('');

        $('#billingaddress_detail').attr('disabled', 'disabled');
        $('#billingaddress_detail').val('');
    } else {
        $('#billingaddress_city').removeAttr('disabled');

        $('#billingaddress_area').removeAttr('disabled');

        $('#billingaddress_detail').removeAttr('disabled');
    }
}
